import React from 'react';
import './App.scss';
import Navigation from './containers/Navigation/Navigation.js'
import Menu from './containers/Menu/Menu.js'
import Main from './containers/Main/Main.js'


function App() {
  return (
    <div className="App">
      <Navigation />
      <div className='container'>

      </div>
      <div className='row'>
        <div className='col-2'>
          <Menu />
        </div>
        <div className='col-10'>
          <Main />
        </div>
      </div>
    </div>
  );

}

export default App;
